export function Welcome() {
    return (
      <div className='container-welcome'>
        <img className='image-burger'
        src={require('../img/burger-render.png')}
        alt='Rico burger'/>
        <i className='fas fa-car-side fa-3x animation '>

        </i><div className='name-company'>
          <h1 className='title'>Burger queen</h1>
        </div>
      </div>
    )
}
